import React from "react";
import './App.css'
import Navigation from "./Components/Header/Navbar/NavBar";
import { Link } from 'react-router-dom';



function App() {
  return (
    <div className="App">
      <div >
                        <Link to="/" >
                            ECO drvin
                        </Link>
                        <ul >
                            <li >
                                <Link to="/" >
                                    Home
                                </Link>
                            </li>
                            <li >
                                <Link to="/" >
                                    About
                                </Link>
                            </li>
                        </ul>
        </div>
    <button className="click">Click Me!</button>
    </div>
  );
}

export default App;
